import React from "react";
import JourneyCard from "../components/JourneyCard";

function HomePage() {
  return (
    <div className="home-page">
      <h1>Your Travel Diaries</h1>
      <div className="journey-list">
        {/* Rendering JourneyCard components */}
        <JourneyCard />
        <JourneyCard />
      </div>
    </div>
  );
}

export default HomePage;
